const URL = 'http://localhost:4000/rest/movies';

export const findAllMovies = () =>
    fetch(URL)
    .then(response => response.json());

export const deleteMovie = (movie) =>
    fetch(`${URL}/${movie._id}`, {
      method: 'DELETE',
    });

export default {
  findAllMovies, deleteMovie
};
